export const getCauseAreaIconById = (id: number) => {
  switch (id) {
    case 1:
      return <GlobalHealthIcon />;
    case 2:
      return <AnimalWelfareIcon />;
    case 3:
      return <FutureGenerationsIcon />;
    case 4:
      return <OperationsIcon />;
    case 5:
      return <OtherIcon />;
    default:
      return <CauseAreaIcon />;
  }
};

